import React from "react";
import "./Projects.css";

export default function Projects() {
    return (
        <div>
        <h2>Skills</h2>
            <div class="logos">
              <a href="#" title="HTML"><img src="html-logo.png" alt="HTML"></img></a>
              <a href="#" title="CSS"><img src="css-logo.png" alt="CSS"/></a>
              <a href="#" title="JavaScript"><img src="js-logo.png" alt="JavaScript"/></a>
              <a href="#" title="Python"><img src="python-logo.png" alt="Python"/></a>
            </div>
        </div>
    );
}
